export default function Agenda({ contactos }) {
  return (
    <div className="container list-group w-50">
      <h3>Lista de contactos</h3>
      <div clasName="row">
        {contactos.map(
          (
            { id, nombre, apellido, direccion, ciudad, cod, telefono },
            index
          ) => (
            <div className="col">
              <ul key={id}>
                <li className="list-group-item list-group-item-action active">
                  Contacto {index}
                </li>
                <li className="list-group-item list-group-item-action">
                  {nombre}
                </li>
                <li className="list-group-item list-group-item-action">
                  {apellido}
                </li>
                <li className="list-group-item list-group-item-action">
                  {telefono}
                </li>
                <li className="list-group-item list-group-item-action">
                  {direccion}, {cod}, {ciudad}
                </li>
                <li className="list-group-item list-group-item-action">
                  <button className="btn btn-warning">Eliminar</button>
                </li>
              </ul>
            </div>
          )
        )}
      </div>
    </div>
  );
}
